import React, {Fragment} from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
const Content = () => {
    return ( 
        <Fragment>
            <Header />
            <div className="row">
                <div className="col-md-2 bg-danger">
                <Sidebar />
                </div>
               <div className="col-md-12">
                <h2>Contenido aqui</h2>
               </div>
            </div>
            
            
        </Fragment>


     );
}
 
export default Content;
